import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const ThankYou = ({ submitted }) => {
    const navigate = useNavigate();

    useEffect(() => {
        if(!submitted) {
            navigate('/');
        }
    }, [submitted, navigate]);

    return (
        <div>
            <h1>Thank you for claiming your seat!</h1>
            <p>We've received your details and will be in touch with you soon.</p>
        </div>
    );
};
